import React from "react";
import EmployeeCard from "./components/EmployeeCard";
import Navbar from "./components/Navbar";
import Wrapper from './components/Wrapper';
import Footer from './components/Footer';


function App() {
  return (
    <div>
      <Navbar />
      <Wrapper>
          <EmployeeCard />
      </Wrapper>
      <Footer />
    </div>
  );
}

export default App;
